import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";

import React from 'react'
import './App.css';
import Header from './components/Header'
import NotesListPage from './pages/NotesListPage'
import NotePage from './pages/NotePage'
function App() {
  return (
      <div>
        <Header />
        <Router><Route path='/' exact component={NotesListPage}></Route></Router>
        <Router><Route path='/note' exact component={NotePage}></Route></Router>
      </div>
  );
}

export default App;
